type bit = D0 | D1

and vector = Empty_vector | V of bit * vector

and matrix = Empty_matrix | M of vector * matrix ;;

let rec print_Bit (rec_x:bit) =
   match rec_x with
   | D0 ->
      print_string "D0"
   | D1 ->
      print_string "D1"

and print_Vector (rec_x:vector) =
   match rec_x with
   | Empty_vector ->
      print_string "Empty_vector"
   | V (rec_x1, rec_x2) ->
      print_string "V";
      print_string " (";
      print_Bit rec_x1;
      print_string ",";
      print_Vector rec_x2;
      print_string ")"

and print_Matrix (rec_x:matrix) =
   match rec_x with
   | Empty_matrix ->
      print_string "Empty_matrix"
   | M (rec_x1, rec_x2) ->
      print_string "M";
      print_string " (";
      print_Vector rec_x1;
      print_string ",";
      print_Matrix rec_x2;
      print_string ")"
;;

let rec btimes (rec_x1:bit) (rec_x2:bit) : bit =
   match rec_x1, rec_x2 with
   | D0, x -> D0
   | D1, x -> x

and plus (rec_x1:bit) (rec_x2:bit) : bit =
   match rec_x1, rec_x2 with
   | D0, x -> x
   | D1, x -> D1

and vchop (rec_x1:matrix) : matrix =
   match rec_x1 with
   | (M ((V (x, u)), n)) -> (M (u, (vchop n)))
   | Empty_matrix -> Empty_matrix

and innerProduct (rec_x1:vector) (rec_x2:matrix) : bit =
   match rec_x1, rec_x2 with
   | (V (x, u)), (M ((V (y, vEC)), l)) -> (plus (btimes x  y)  (innerProduct u  l))
   | Empty_vector, Empty_matrix -> D0

and vecMat (rec_x1:vector) (rec_x2:matrix) : vector =
   match rec_x1, rec_x2 with
   | u, (M ((V (y, vEC)), l)) -> (V ((innerProduct u  (M ((V (y, vEC)), l))), (vecMat u  (vchop (M ((V (y, vEC)), l))))))
   | u, (M (Empty_vector, l)) -> Empty_vector

and mtimes (rec_x1:matrix) (rec_x2:matrix) : matrix =
   match rec_x1, rec_x2 with
   | (M (u, n)), l -> (M ((vecMat u  l), (mtimes n  l)))
   | Empty_matrix, l -> Empty_matrix

and closure (rec_x1:matrix) : matrix =
   match rec_x1 with
   | l when l = (mtimes l  l) -> l
   | l when l <> (mtimes l  l) -> (closure (mtimes l  l))
;;

